import React from 'react';

const Sidebar = () => {
  return (
    <div className="bg-light p-3" style={{ minHeight: '100vh', width: '250px' }}>
      <h4>Chat App</h4>
      <ul className="list-unstyled">
        <li>
          <a href="#" className="d-block p-2 text-dark">Dashboard</a>
        </li>
        <li>
          <a href="#" className="d-block p-2 text-dark">User Group</a>
        </li>
        <li>
          <a href="#" className="d-block p-2 text-dark">Messages</a>
        </li>
        <li>
          <a href="#" className="d-block p-2 text-dark">Logout</a>
        </li>
      </ul>
    </div>
  );
};

export default Sidebar;
